import React from "react";
import Navbar from './components/Navbar'
import Home from './home';
import "./App.css";
import { BrowserRouter as Router, Route } from "react-router-dom";


function App() {
  return (
    <div className="App">
      <Router>
        <Route path="/" component={Navbar} exact />

      </Router>
    </div>
  );
}

export default App;
